import {data} from "./data"
import styled from "styled-components"

function Gallery() {

	const photos = data.map((a, i) => <div key={a.id}>
	  <img src={a.img} alt={a.title} />
	</div>)

	return (
	 <div className="container">
	   <h2>hello gallery</h2>
	   {photos}
	 </div>
	)
}

export default Gallery
